import React from "react";
import './movie.css'
const MovieCards = (props) => {
  console.log("dream", props);
  return (
    <div class="card">
      <h2>{props.name}</h2>
      <p>{props.rating}</p>
      <p>{props.release_Date}</p>
    </div>
  );
};

export default MovieCards;
